insert /*+ append */ into <?=snpRef.getObjectName("L", "%INT_PRFTRG_PRODUCT", "W") ?> ( PRICE, PRODUCT, IND_UPDATE ) select PRICE, PRODUCT, IND_UPDATE from (
select
SRC_PRODUCT.PRICE PRICE, SRC_PRODUCT.PRODUCT PRODUCT,
'I' IND_UPDATE
from <?=snpRef.getObjectName("L", "SRC_PRODUCT", "ORA_SOURCE_ODI", "", "D")?> SRC_PRODUCT where (1=1)
) S where NOT EXISTS ( select 1 from <?=snpRef.getObjectName("L", "TRG_PRODUCT", "ORA_TARGET_ODI", "", "D") ?> T where T.PRODUCT_ID = S.PRODUCT_ID and ((T.PRICE = S.PRICE) or (T.PRICE IS NULL and S.PRICE IS NULL)) and ((T.PRODUCT = S.PRODUCT) or (T.PRODUCT IS NULL and S.PRODUCT IS NULL)) )

begin
    dbms_stats.gather_table_stats(
	ownname => '<?=snpRef.getInfo("DEST_WORK_SCHEMA") ?>',
	tabname => '<?=snpRef.getObjectName("L", "%INT_PRFTRG_PRODUCT", "W").replaceAll(odiRef.getInfo( "DEST_WORK_SCHEMA" )+".","")?>',
	estimate_percent => dbms_stats.auto_sample_size
    );
end;


